    /** 
     * next Token method that allows you to control if whitespace and comments are
     * returned as tokens.
     */
    public Token getNextToken(boolean returnComments, boolean returnWhiteSpace)throws IOException{
        Token t = getNextToken();
        while (t != null && ((!returnWhiteSpace && t.isWhiteSpace()) || (!returnComments && t.isComment()))){
            t = getNextToken();
        }
        return (t); 
    }

    public SqlAliasFinderLexer(){}

    private static final String END = "[[[END]]]";

    public String findTable(String sql) throws IOException {
        StringReader in = new StringReader(sql);
        return findTable(in);
    }

    private String findTable(Reader sql) throws IOException {
        reset(sql, 0, 0, 0);
        SQLToken t;
        String first = null;
        boolean from = false;
        boolean end = false;
        while ((t = (SQLToken) getNextToken()) != null) {
            switch (t.getID()) {
                case SQLToken.COMMENT_END_OF_LINE:
                case SQLToken.COMMENT_TRADITIONAL:
                case SQLToken.WHITE_SPACE:
                    break;
                case SQLToken.RESERVED_FROM:
                    from = true;
                    break;
                case SQLToken.RESERVED_SELECT:
                    end = false;
                case SQLToken.IDENTIFIER:
                    if (from){
                        if (first == null){
                            first = t.getContents();
                        } else {
                            first = null;
                        }
                    }
                    break;
                case SQLToken.SEPARATOR_END:
                    if (first != null && from) {
                        return first;
                    }
                    return END;
                default:
                    if (first != null && from){
                        return first;
                    }

                    if (from){
                        return END;
                    }
                    first = null;
                    break;
            }
        }
        if (first != null && from) {
            return first;
        } else if (end){
            return END;
        } else {
            return null;
        }
    }

    /**
     * find a alias and return the table name if found else return null
     */
    public String findAlias(String sql, String alias, boolean top) throws IOException {
        StringReader in = new StringReader(sql);
        return parse(in, alias,top);
    }

    public String parse(Reader sql, String alias, boolean top) throws IOException {
        reset(sql, 0, 0, 0);
        SQLToken t;
        String first = null;
        boolean found = false;
        while ((t = (SQLToken) getNextToken()) != null) {
            switch (t.getID()) {
                case SQLToken.COMMENT_END_OF_LINE:
                case SQLToken.COMMENT_TRADITIONAL:
                case SQLToken.WHITE_SPACE:
                    break;
                case SQLToken.IDENTIFIER:
                    if (first == null){
                        first = t.getContents();
                    } else {
                        if (alias.equalsIgnoreCase(t.getContents())){
                            if (!top){
                                return first;
                            } else {
                                found = true;
                            }
                        } else {
                            if (!found) {
                                first = t.getContents();
                            }
                        }
                    }
                    break;
                case SQLToken.SEPARATOR_END:
                    return END;
                default:
                    if (!found){
                        first = null;
                    }
                    break;
            }
        }
        if (found){
            return first;
        } else {
            return null;
        }
    }
    /**
     * Closes the current input stream, and resets the scanner to read from a new input stream.
	 * All internal variables are reset, the old input stream  cannot be reused
	 * (content of the internal buffer is discarded and lost).
	 * The lexical state is set to the initial state.
     * Subsequent tokens read from the lexer will start with the line, char, and column
     * values given here.
     *
     * @param reader The new input.
     * @param yyline The line number of the first token.
     * @param yychar The position (relative to the start of the stream) of the first token.
     * @param yycolumn The position (relative to the line) of the first token.
     * @throws IOException if an IOExecption occurs while switching readers.
     */
    public void reset(java.io.Reader reader, int yyline, int yychar, int yycolumn) throws IOException{
        yyreset(reader);
        this.yyline = yyline;
		this.yychar = yychar;
		this.yycolumn = yycolumn;
	}

